import { createTheme } from '@mui/material';

const theme = createTheme({
    palette: {
        primary: {
            main: "#212121",
            light: "#212121",
            dark: "#212121",
        },

        info: {
            main: "#212121",
            light: "#212121",
            dark: "#212121",
        }
    },
});

export default theme;
